INSERT INTO `templates` VALUES (29739,'codemaps_tmplt','{{define \"codemaps_tmplt\"}}\n<!DOCTYPE html>\n<html>\n    <head>\n        <title>Workflow Service</title>\n        <meta charset=\"utf-8\" />\n        <link rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.1.3/css/bootstrap.min.css\"\n            integrity=\"sha384-MCw98/SFnGE8fJT3GXwEOngsV7Zt27NXFoaoApmYm81iuXoPkFOJwJ8ERdknLPMO\" crossorigin=\"anonymous\">\n        <script src=\"https://code.jquery.com/jquery-3.3.1.min.js\"></script>\n        <script src=\"https://unpkg.com/gijgo@1.9.14/js/gijgo.js\" type=\"text/javascript\"></script>\n        <script src=\"https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js\"></script>\n        <link href=\"https://unpkg.com/gijgo@1.9.14/css/gijgo.css\" rel=\"stylesheet\" type=\"text/css\" />\n        <link rel=\"stylesheet\" href=\"https://cdn.jsdelivr.net/npm/bootstrap@3.4.1/dist/css/bootstrap.min.css\"\n            integrity=\"sha384-HSMxcRTRxnN+Bdg0JdbxYKrThecOKuH5zCYotlSAcp1+c8xmyTe9GYg1l9a69psu\" crossorigin=\"anonymous\">\n    </head>\n\n    <body>\n        <script type=\"text/javascript\" src=\"https://cdn.jsdelivr.net/gh/bbbootstrap/libraries@main/jquery.tabledit.js\"></script>\n        <div class=\"row\">\n            <div class=\"col-md-12\">\n                <div class=\"card\">\n                    <div class=\"card-header\">\n                        <span>Click on value to perform edit action then Press Enter to Save</span>\n                    </div>\n                    <div class=\"card-block\">\n                        <div class=\"table-responsive\">\n                            <table class=\"table table-striped table-bordered\" id=\"codemaptable\">\n                                <thead>\n                                    <tr>\n                                        <th style=\"display: none;\">#</th>\n                                        <th>Local ID</th>\n                                        <th>Mapped ID</th>\n                                    </tr>\n                                </thead>\n                                <tbody>\n                                    {{range .IdMaps.LidMap}}\n                                    {{if ne \"\" .Lid}}\n                                    <tr>\n                                        <td scope=\"row\" style=\"display: none;\">{{.Id}}</td>\n                                        <td class=\"tabledit-view-mode\" style=\"cursor: pointer;\">\n                                            <span class=\"tabledit-span\">{{.Lid}}</span>\n                                            <input class=\"tabledit-input form-control input-sm\" type=\"text\" name=\"lid\" value=\"{{.Lid}}\" style=\"display: none;\" id=\"lid\" disabled=\"\">\n                                        </td>\n                                        <td class=\"tabledit-view-mode\" style=\"cursor: pointer;\">\n                                            <span class=\"tabledit-span\">{{.Mid}}</span>\n                                            <input class=\"tabledit-input form-control input-sm\" type=\"text\" name=\"mid\" value=\"{{.Mid}}\" style=\"display: none;\" id=\"mid\" disabled=\"\">\n                                        </td>\n                                    </tr>\n                                    {{end}}\n                                    {{end}}\n                                </tbody>\n                            </table>\n                        </div>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div class=\"container-fluid\">\n            <form id=\"codemap-form\" action=\"{{.EnvVars.XDW_SERVER_URL}}/spa/publisher/codemap\" method=\"post\">\n                <input hidden class=\"form-control\" id=\"act\" name=\"action\" value=\"insert\">\n                <input hidden class=\"form-control\" id=\"org\" name=\"org\" value=\"{{.Query.Org}}\">\n                <input hidden class=\"form-control\" id=\"role\" name=\"role\" value=\"{{.Query.Role}}\">\n                <input hidden class=\"form-control\" id=\"user\" name=\"user\" value=\"{{.Query.User}}\">\n                <label for=\"lid\">Local Value</label>\n                <input class=\"form-control\" id=\"lid\" name=\"lid\">\n                <label for=\"mid\">Mapped Value</label>\n                <input class=\"form-control\" id=\"mid\" name=\"mid\">\n                <button type=\"submit\">Save New Codemap</button>\n                <hr></hr>\n            </form>\n        </div>\n        <script>\n            $(document).ready(function(){\n                $(\'#codemaptable\').Tabledit({\n                    url: \'{{.EnvVars.XDW_SERVER_URL}}/spa/publisher/codemap?action=edit\', editButton: false, deleteButton: false, hideIdentifier: true, columns: \n                        {identifier: [0, \'id\'], editable: [[1, \'lid\'], [2, \'mid\']]}\n                });\n            });\n        </script>\n    </body>\n    <style>\n        .mt-100{margin-top:100px}.container-fluid{margin-top:50px}body{background-color:#f2f7fb}.card{border-radius: 5px;-webkit-box-shadow: 0 0 5px 0 rgba(43,43,43,0.1), 0 11px 6px -7px rgba(43,43,43,0.1);box-shadow: 0 0 5px 0 rgba(43,43,43,0.1), 0 11px 6px -7px rgba(43,43,43,0.1);border: none;margin-bottom: 30px;-webkit-transition: all 0.3s ease-in-out;transition: all 0.3s ease-in-out}.card .card-header{background-color: transparent;border-bottom: none;padding: 20px;position: relative}.card .card-block{padding: 1.25rem}.table-responsive{display: inline-block;width: 100%;overflow-x: auto}.card .card-block table tr{padding-bottom: 20px}.table>thead>tr>th{border-bottom-color: #ccc}.table th{padding: 1.25rem 0.75rem}td, th{white-space: nowrap}.tabledit-input:disabled{display: none}.btn-primary, .sweet-alert button.confirm, .wizard>.actions a{background-color: #4099ff;border-color: #4099ff;color: #fff;cursor: pointer;-webkit-transition: all ease-in 0.3s;transition: all ease-in 0.3s}.btn{border-radius: 2px;text-transform: capitalize;font-size: 15px;padding: 10px 19px;cursor: pointer}\n    </style>\n</html>\n{{end}}','system'),(31624,'spasidebar2t_tmplt','{{define \"spasidebar_2t\"}}\n<div class=\"col-lg-3 col-md-4 col-sm-6 col-xs-12 sidebar\" id=\"sidebar\" name=\"sidebar\">\n    <p style=\"text-align: center;color: rgba(28, 8, 35, 0.199);font-size:xx-large;\">Menu</p>\n    <ul id=\"creatorul\" style=\"display: none;\">\n        <div class=\"trigger\">\n            <li onclick=\"showprogress()\"><a id=\"sidebarCreator\" href=\"\" target=\"iconsumer\">Create Workflow</i></a></li>\n            <div class=\"popup\">\n                Create a New Workflow\n            </div>\n        </div>\n        <hr></hr>\n    </ul>\n    <ul id=\"hasnhsidul\" style=\"display: none;\">\n        <div class=\"trigger\">\n            <li onclick=\"showprogress()\"><a id=\"sidebarAllPDQ\" href=\"\" target=\"iconsumer\">Patient Details</a></li>\n            <div class=\"popup\">\n                Patient Information\n            </div>\n        </div>\n        <hr></hr>\n    </ul>\n    <ul>\n        <div class=\"trigger\">\n            <li onclick=\"showprogress()\"><a id=\"sidebarmySubs\" href=\"\" target=\"iconsumer\">My Subscriptions</a></li>\n            <div class=\"popup\">\n                Show My Subscriptions\n            </div>\n        </div>\n    </ul>\n    <ul id=\"haspwyul\" style=\"display: none;\">\n        <div class=\"trigger\">\n            <li onclick=\"showprogress()\"><a id=\"sidebarSubs\" href=\"\" target=\"iconsumer\">New Subscription</a></li>\n            <div class=\"popup\">\n                Subscribe to Events\n            </div>\n        </div>\n        <hr></hr>\n    </ul>\n    <ul>\n        <div class=\"trigger\">\n            <li onclick=\"showprogress()\"><a id=\"sidebarCodemaps\" href=\"\" target=\"iconsumer\">My CodeMaps</a>\n            </li>\n            <div class=\"popup\">\n                Create or Edit CodeMap\n            </div>\n        </div>\n    </ul>\n    <ul>\n        <li>Register</li>\n        <ul class=\"list-unstyled components\">\n            <div class=\"trigger\">\n                <li onclick=\"showprogress()\"><a id=\"sidebarRegister\" href=\"{{.XDW_SERVER_URL}}/publisher/definition\"\n                        target=\"iconsumer\">Workflow</a></li>\n                <div class=\"popup\">\n                    Create New Workflow Definition\n                </div>\n            </div>\n            <hr>\n            </hr>\n            <div class=\"trigger\">\n                <li onclick=\"showprogress()\">\n                    <a id=\"sidebarRegister\" href=\"{{.XDW_SERVER_URL}}/publisher/template\" target=\"iconsumer\">Template</a>\n                </li>\n                <div class=\"popup\">\n                    Create New HTML Template\n                </div>\n            </div>\n            <hr>\n            </hr>\n        </ul>\n        <hr>\n        </hr>\n        <div class=\"trigger\">\n            <li>\n                <a href=\"#\" onclick=\"initTmplts()\">Update Templates</a>\n            </li>\n            <div class=\"popup\">\n                Load Templates from Local Folder\n            </div>\n        </div>\n    </ul>\n    <hr></hr>\n</div>\n{{end}}','system'),(39456,'publishfile2t_tmplt','{{define \"publishfile2t_tmplt\"}}\n<!DOCTYPE html>\n<html>\n\n<head>\n    <meta charset=\"UTF-8\">\n    <title>ICB Workflow Service</title>\n    <style>\n        #drop-area {\n            border: 2px dashed #ccc;\n            border-radius: 5px;\n            padding: 25px;\n            text-align: center;\n            font-size: 20px;\n            margin-bottom: 20px;\n        }\n\n        #drop-area.dragging {\n            border-color: #009688;\n        }\n    </style>\n</head>\n\n<body>\n    <h1 style=\"text-align: center;\">{{.Query.Act}}</h1>\n    <form method=\"POST\" action=\"/spa/publisher/upload\" enctype=\"multipart/form-data\">\n        <div id=\"drop-area\">\n            <p id=\"drop-area-p\">Drag and drop your file here, then click {{.Query.Act}}</p>\n            <input type=\"file\" id=\"file\" name=\"file\" style=\"display: none;\">\n        </div>\n        <input hidden type=\"text\" id=\"act\" name=\"act\" value=\"{{.Query.Act}}\">\n        <input hidden type=\"text\" id=\"pathway\" name=\"pathway\" style=\"display: none;\" value=\"{{.Query.Pathway}}\">\n        <input hidden type=\"text\" id=\"expression\" name=\"expression\" style=\"display: none;\" , value=\"{{.Query.Expression}}\">\n        <input hidden type=\"text\" id=\"topic\" name=\"topic\" style=\"display: none;\" , value=\"{{.Query.Topic}}\">\n        <input hidden type=\"text\" id=\"vers\" name=\"vers\" style=\"display: none;\" , value=\"{{.Query.Vers}}\">\n        <input hidden type=\"text\" id=\"nhs\" name=\"nhs\" style=\"display: none;\" , value=\"{{.Query.Nhs}}\">\n\n        <button type=\"submit\">{{.Query.Act}}</button>\n    </form>\n    <script>\n        const dropArea = document.getElementById(\'drop-area\');\n\n        [\'dragenter\', \'dragover\', \'dragleave\', \'drop\'].forEach(eventName => {\n            dropArea.addEventListener(eventName, preventDefaults, false)\n        });\n\n        function preventDefaults(e) {\n            e.preventDefault();\n            e.stopPropagation();\n        }\n\n        [\'dragenter\', \'dragover\'].forEach(eventName => {\n            dropArea.addEventListener(eventName, highlight, false)\n        });\n\n        [\'dragleave\', \'drop\'].forEach(eventName => {\n            dropArea.addEventListener(eventName, unhighlight, false)\n        });\n\n        function highlight(e) {\n            dropArea.classList.add(\'dragging\');\n        }\n\n        function unhighlight(e) {\n            dropArea.classList.remove(\'dragging\');\n        }\n\n        dropArea.addEventListener(\'drop\', handleDrop, false);\n\n        function handleDrop(e) {\n            const fileInput = document.getElementById(\'file\');\n            const files = e.dataTransfer.files;\n            fileInput.files = files;\n            document.getElementById(\"drop-area-p\").innerHTML = files[0].name\n        }\n    </script>\n</body>\n\n</html>\n\n{{end}}','system'),(39457,'react_tmplt','<!DOCTYPE html>\n<html>\n    <head>\n        <meta charset=\"UTF-8\">\n        <meta name=\"viewport\" content=\"width=device-width,initial-scale=1.0\">\n        <title>React Dev</title>\n        <script src=\"https://unpkg.com/react@17/umd/react.development.js\" crossorigin></script>\n        <script src=\"https://unpkg.com/react-dom@17/umd/react-dom.development.js\" crossorigin></script>\n    </head>\n<body>\n    <div id=\"root\">0</div>\n    <script src=\'react_tmplt.js\'></script>\n</body>','system'),(39662,'dsubcancel_tmplt','{{define \"dsubCancel_tmplt\"}}\n<soap:Envelope xmlns:soap=\'http://www.w3.org/2003/05/soap-envelope\'>\n    <soap:Header>\n        <Action xmlns=\'http://www.w3.org/2005/08/addressing\' soap:mustUnderstand=\'true\'>http://docs.oasis-open.org/wsn/bw-2/SubscriptionManager/UnsubscribeRequest</Action>\n        <MessageID xmlns=\'http://www.w3.org/2005/08/addressing\' soap:mustUnderstand=\'true\'>urn:uuid:{{newuuid}}</MessageID>\n        <To xmlns=\'http://www.w3.org/2005/08/addressing\' soap:mustUnderstand=\'true\'>{{.Query.BrokerRef}}</To>\n        <ReplyTo xmlns=\'http://www.w3.org/2005/08/addressing\' soap:mustUnderstand=\'true\'>\n            <Address>http://www.w3.org/2005/08/addressing/anonymous</Address>\n        </ReplyTo>\n    </soap:Header>\n    <soap:Body>\n        <Unsubscribe xmlns=\'http://docs.oasis-open.org/wsn/b-2\'\n            xmlns:ns2=\'http://www.w3.org/2005/08/addressing\'\n            xmlns:ns3=\'http://docs.oasis-open.org/wsrf/bf-2\'\n            xmlns:ns4=\'urn:oasis:names:tc:ebxml-regrep:xsd:rim:3.0\'\n            xmlns:ns5=\'urn:oasis:names:tc:ebxml-regrep:xsd:rs:3.0\'\n            xmlns:ns6=\'urn:oasis:names:tc:ebxml-regrep:xsd:lcm:3.0\'\n            xmlns:ns7=\'http:/