uration}}</td>\n                                                                        {{if eq .TimeRemaining \"0\"}}\n                                                                        {{if eq .InProgress \"TRUE\"}}\n                                                                        <td>Overdue</td>\n                                                                        {{else}}\n                                                                        <td>Complete</td>\n                                                                        {{end}}\n                                                                        {{else}}\n                                                                        <td>{{.TimeRemaining}}</td>\n                                                                        {{end}}\n                                                                    </tr>\n                                                                    {{end}}\n                                                                    {{end}}\n                                                                </tbody>\n                                                            </table>\n                                                        </div>\n                                                    </td>\n                                                </tr>\n                                                {{end}}\n                                                {{end}}\n                                            </tbody>\n                                        </table>\n                                    </div>\n                                </td>\n                            </tr>\n                        </tbody>\n                    </table>\n                </div>\n            </div>\n        </div>\n    </div>\n    <script src=\"https://code.jquery.com/jquery-1.12.4.min.js\"\n        integrity=\"sha384-nvAa0+6Qg9clwYCGGPpDQLVpLNn0fRaROjHqs13t4Ggj3Ez50XnGQqc/r8MhnRDZ\"\n        crossorigin=\"anonymous\"></script>\n    <script src=\"https://cdn.jsdelivr.net/npm/bootstrap@3.4.1/dist/js/bootstrap.min.js\"\n        integrity=\"sha384-aJ21OjlMXNL5UyIl/XNwTMqvzeRMZH2w8c5cRVpzpU8Y5bApTppSuUkhZXN0VxHd\"\n        crossorigin=\"anonymous\"></script>\n    </body>\n    <style>\n        body {\n            padding-top: 50px;\n            background-color: #34495e;\n            font-family: sans-serif;\n        }\n    \n        .hiddenRow {\n            padding: 0 !important;\n        }\n        \n        .popup {\n            position: absolute;\n            display: none;\n            background-color: #f1f1f1;\n            padding: 10px;\n            border: 1px solid #ccc;\n            z-index: 1;\n            font-family: sans-serif;\n        }\n        \n        .trigger {\n            position: relative;\n            display: inline-block;\n        }\n        \n        .trigger:hover .popup {\n            display: block;\n        }\n    </style>\n</html>\n{{end}}','system'),(39668,'pdsretrieve_tmplt','{{define \"pdsretrieve_tmplt\"}}\n{{$user := .Query.User}}\n{{$rsp := .PDSRetrieveResponse}}\n{{$td := \"\"}}\n<tr class=\"info\">\n    <th>Prefix</th>\n    <th>Fist Name</th>\n    <th>Last Name</th>\n    <th>Suffix</th>\n    <th>Use</th>\n    <th>Start</th>\n    <th>End</th>\n    <th>Gender</th>\n    <th>DOB</th>\n    <th>Multiple Birth</th>\n    {{if not $rsp.DeceasedDateTime.IsZero}}\n    <th>Deceased</th>\n    {{end}}\n    <th>GP Practice</th>\n</tr>\n{{range $rsp.Name}}\n<tr>\n    {{- range $index, $value := .Prefix }}\n    {{- if $index }},{{ end }}\n    {{- $td = (printf \"%s%s\" $td $value) }}\n    {{- end }}\n    <td>{{$td}}</td>\n    {{$td = \"\"}}\n    {{- range $index, $value := .Given }}\n    {{- if $index }},{{ end }}\n    {{- $td = (printf \"%s%s\" $td $value) }}\n    {{- end }}\n    <td>{{$td}}</td>\n    <td>{{.Family}}</td>\n    {{$td = \"\"}}\n    {{- range $index, $value := .Suffix }}\n    {{- if $index }},{{ end }}\n    {{- $td = (printf \"%s%s\" $td $value) }}\n    {{- end }}\n    <td>{{$td}}</td>\n    <td>{{.Use}}</td>\n    <td>{{.Period.Start}}</td>\n    <td>{{.Period.End}}</td>\n    <td>{{$rsp.Gender}}</td>\n    <td>{{$rsp.BirthDate}}</td>\n    <td>{{$rsp.MultipleBirthInteger}}</td>\n    {{if not $rsp.DeceasedDateTime.IsZero}}\n    <td>{{$rsp.DeceasedDateTime}}</td>\n    {{end}}\n    <td>{{$rsp.ManagingOrganization.Identifier.Value}}</td>\n</tr>\n{{end}}\n<tr>\n    <td colspan=\"12\" class=\"hiddenRow\">\n        <div class=\"accordian-body collapse\" id=\"pds1\">\n            <table class=\"table table-striped\">\n                <thead>\n                    <tr class=\"info\">\n                        <th>House</th>\n                        <th>Street</th>\n                        <th>Town</th>\n                        <th>City</th>\n                        <th>County</th>\n                        <th>Postcode</th>\n                        <th>Use</th>\n                        <th>Type</th>\n                        <th>Period</th>\n                        <th>PAF</th>\n                        <th>UPRN</th>\n                    </tr>\n                </thead>\n                <tbody>\n                    {{range $rsp.Address}}\n                    {{$addr := .}}\n                    <tr>\n                        {{range .Line}}\n                        <td>{{.}}</td>\n                        {{end}}\n                        <td>{{$addr.PostalCode}}</td>\n                        <td>{{$addr.Use}}</td>\n                        <td>{{$addr.Text}}</td>\n                        <td>{{$addr.Period.Start}} - {{$addr.Period.End}}</td>\n                        {{- range $index, $value := $addr.Extension }}\n                            {{$foundPaf := \"false\"}}\n                            {{- range $i, $v := .Extension }}\n                                {{if eq $v.ValueCoding.Code \"PAF\"}}\n                                    {{$foundPaf = \"true\"}}\n                                {{end}}\n                                {{if and (eq $foundPaf \"true\") (ne $v.ValueString \"\")}}\n                                <td>{{$v.ValueString}}</td>\n                                {{end}}\n                            {{- end }}\n                        {{end}}\n                        {{- range $index, $value := $addr.Extension }}\n                        {{$foundUprn := \"false\"}}\n                        {{- range $i, $v := .Extension }}\n                        {{if eq $v.ValueCoding.Code \"UPRN\"}}\n                        {{$foundUprn = \"true\"}}\n                        {{end}}\n                        {{if and (eq $foundUprn \"true\") (ne $v.ValueString \"\")}}\n                        <td>{{$v.ValueString}}</td>\n                        {{end}}\n                        {{- end }}\n                        {{end}}\n                    </tr>\n                    {{end}}\n                </tbody>\n            </table>\n        </div>\n    </td>\n</tr>\n<tr>\n    <td colspan=\"12\" class=\"hiddenRow\">\n        <div class=\"accordian-body collapse\" id=\"pds2\">\n            <table class=\"table table-striped\">\n                <thead>\n                    <tr class=\"info\">\n                        <th>System</th>\n                        <th>Value</th>\n                        <th>Use</th>\n                        <th>Start</th>\n                        <th>End</th>\n                        <th>Extension</th>\n                    </tr>\n                </thead>\n                <tbody>\n                    {{range $rsp.Telecom}}\n                    <tr>\n                        <td>{{.System}}</td>\n                        <td>{{.Value}}</td>\n                        <td>{{.Use}}</td>\n                        <td>{{.Period.Start}}</td>\n                        <td>{{.Period.End}}</td>\n                        {{range .Extension}}\n                        <td>{{.ValueCoding.Display}}</td>\n                        {{end}}\n                    </tr>\n                    {{end}}\n                    {{range $rsp.Contact}}\n                    <tr>\n                        {{$contact := .}}\n                        {{range $contact.Telecom}}\n                        <td>{{.System}}</td>\n                        <td>{{.Value}}</td>\n                        {{end}}\n                        {{range $contact.Relationship}}\n                            {{range .Coding}}\n                            <td>{{.Display}}</td>\n                            {{end}}\n                        {{end}}\n                        <td>{{$contact.Period.Start}}</td>\n                        <td>{{$contact.Period.End}}</td>\n                    </tr>\n                    {{end}}\n                </tbody>\n            </table>\n        </div>\n    </td>\n</tr>\n<tr>\n    <td colspan=\"12\" class=\"hiddenRow\">\n        <div class=\"accordian-body collapse\" id=\"pds3\">\n            <table class=\"table table-striped\">\n                <thead>\n                    <tr class=\"info\">\n                        <th>Description</th>\n                        <th>Value</th>\n                    </tr>\n                </thead>\n                <tbody>\n                    {{range $rsp.Extension}}\n                        {{if eq (len .Extension) 0}}\n                            <tr>\n                                <td>{{mappedid $user .URL}}</td>\n                                {{if eq .URL \"http://hl7.org/fhir/StructureDefinition/patient-birthPlace\"}}\n                                <td>{{.ValueAddress.City}} {{.ValueAddress.District}} {{.ValueAddress.Country}}</td>\n                                {{else}}\n                                <td>{{mappedid $user .ValueReference.Identifier.Value}}</td>\n                                {{end}}\n                            </tr>\n                        {{else}}\n                            {{range .Extension}}\n                                {{if and (ne .URL \"systemEffectiveDate\") (ne .URL \"effectiveTime\")}}\n                                    {{if ne (len .ValueCodeableConcept.Coding) 0}}\n                                        {{$val := \"\"}}\n                                        <tr>\n                                            <td>{{mappedid $user .URL}}</td>\n                                            {{range .ValueCodeableConcept.Coding}}{{$val = .Display}}{{end}}\n                                            <td>{{mappedid $user $val}}</td>\n                                        </tr>\n                                        {{else}}\n                                        <tr>\n                                            <td>{{mappedid $user .URL}}</td>\n                                            {{if eq .URL \"PreferredContactTimes\"}}\n                                            <td>{{.ValueString}}</td>\n                                            {{end}}\n                                            {{if eq .URL \"interpreterRequired\"}}\n                                            <td>{{.ValueBoolean}}</td>\n                                            {{end}}\n                                        </tr>\n                                    {{end}}\n                                {{end}}\n                            {{end}}\n                        {{end}}\n                    {{end}}\n                </tbody>\n            </table>\n        </div>\n    </td>\n</tr>\n{{end}}','system'),(39669,'allpatientSrvs_tmplt','{{define \"allpatientSrvs_tmplt\"}}\n<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n    <meta charset=\"utf-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n    <title>ICB Workflow Service</title>\n\n    <link rel=\"stylesheet\" href=\"https://cdn.jsdelivr.net/npm/bootstrap@3.4.1/dist/css/bootstrap.min.css\"\n        integrity=\"sha384-HSMxcRTRxnN+Bdg0JdbxYKrThecOKuH5zCYotlSAcp1+c8xmyTe9GYg1l9a6