}\n    \n        /* Place the container to the left */\n        .left {\n            left: 0;\n        }\n    \n        /* Place the container to the right */\n        .right {\n            left: 50%;\n        }\n    \n        /* Add arrows to the left container (pointing right) */\n        .left::before {\n            content: \" \";\n            height: 0;\n            position: absolute;\n            top: 22px;\n            width: 0;\n            z-index: 1;\n            right: 30px;\n            border: medium solid white;\n            border-width: 10px 0 10px 10px;\n            border-color: transparent transparent transparent white;\n        }\n    \n        /* Add arrows to the right container (pointing left) */\n        .right::before {\n            content: \" \";\n            height: 0;\n            position: absolute;\n            top: 22px;\n            width: 0;\n            z-index: 1;\n            left: 30px;\n            border: medium solid white;\n            border-width: 10px 10px 10px 0;\n            border-color: transparent white transparent transparent;\n        }\n    \n        /* Fix the circle for containers on the right side */\n        .right::after {\n            left: -16px;\n        }\n    \n        /* The actual content */\n        .content {\n            padding: 20px 30px;\n            background-color: white;\n            position: relative;\n            border-radius: 6px;\n        }\n    \n        /* Media queries - Responsive timeline on screens less than 600px wide */\n        @media screen and (max-width: 600px) {\n    \n            /* Place the timelime to the left */\n            .timeline::after {\n                left: 31px;\n            }\n    \n            /* Full-width containers */\n            .container {\n                width: 100%;\n                padding-left: 70px;\n                padding-right: 25px;\n            }\n    \n            /* Make sure that all arrows are pointing leftwards */\n            .container::before {\n                left: 60px;\n                border: medium solid white;\n                border-width: 10px 10px 10px 0;\n                border-color: transparent white transparent transparent;\n            }\n    \n            /* Make sure all circles are at the same spot */\n            .left::after,\n            .right::after {\n                left: 15px;\n            }\n    \n            /* Make all right containers behave like the left ones */\n            .right {\n                left: 0%;\n            }\n        }\n    </style> -->\n</head>\n{{end}}','system'),(39673,'patpoxy_tmplt','<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Patient Proxy</title>\n    <!-- Include CSS for loading spinner -->\n    <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css\">\n    <style>\n        /* Style for loading spinner */\n        .loader {\n            border: 16px solid #f3f3f3;\n            /* Light grey border */\n            border-top: 16px solid #3498db;\n            /* Blue border */\n            border-radius: 50%;\n            width: 120px;\n            height: 120px;\n            animation: spin 2s linear infinite;\n            margin: 0 auto;\n            display: block;\n            position: absolute;\n            top: 50%;\n            left: 50%;\n            transform: translate(-50%, -50%);\n            z-index: 9999;\n        }\n\n        @keyframes spin {\n            0% { transform: rotate(0deg); }\n            100% { transform: rotate(360deg); }\n        }\n    </style>\n</head>\n<body>\n    <h1>Patient Query Proxy</h1>\n\n    <!-- Loading icons for each data source -->\n    \n    <div class=\"loader\" id=\"loader3\">\n        <p></p>\n    </div>\n\n    \n\n    <!-- JavaScript to fetch and replace data -->\n    <script>\n        function generateUUID() {\n            return \'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx\'.replace(/[xy]/g, function (c) {\n                var r = Math.random() * 16 | 0,\n                    v = c == \'x\' ? r : (r & 0x3 | 0x8);\n                return v.toString(16);\n            });\n        }\n        \n\n        // Fetch data from Source 1\n        \n        // Fetch data from Source 3\n        const uuid = generateUUID();\n            const headersForSource3 = {\n                \'X-Request-ID\': uuid,\n            };\n        fetch(\'https://sandbox.api.service.nhs.uk/personal-demographics/FHIR/R4/Patient/9000000009\', { headersForSource3 })\n                .then(response => response.json())\n                .then(data => {\n                    const element = document.getElementById(\'loader3\');\n                    element.Class = \'\'\n                    element.innerHTML = `Data from ${elementId}: ${JSON.stringify(data)}`;\n                })\n                .catch(error => console.error(error));    </script>\n</body>\n</html>','system'),(39674,'pds_tmplt','{{define \"pds_tmplt\"}}\n{{$user := .Query.User}}\n{{$hasPatient := \"false\"}}\n{{range .PDSRetrieveResponse.Name}}\n    {{if ne .Family \"\"}}\n        {{$hasPatient = \"true\"}}\n    {{end}}\n{{end}}\n<div class=\"col-md-12\">\n    <div class=\"panel panel-default\">\n        <div class=\"panel-heading panel-default\" style=\"text-align: center;color: blue;\">           \n            {{if eq $hasPatient \"false\"}}\n                <span style=\"color: red;\">No NHS Spine PDS Patient Record Found for {{.Query.Nhs}}</span>\n            {{else}}\n                NHS Spine PDS Patient Record for {{.Query.Nhs}}\n                {{if eq .PDSResponse \"retrieve\"}}\n                    {{$conf := \"\"}}\n                    {{range .PDSRetrieveResponse.Meta.Security}}\n                        {{$conf = .Display}}\n                    {{end}}\n                    <td>Confidentiality {{$conf}}</td>\n                    {{if not .PDSRetrieveResponse.DeceasedDateTime.IsZero}}\n                    <span style=\"color: red;\">Patient is Deceased</span>\n                    {{end}}\n                {{else}}\n                    {{if eq .PDSResponse \"search\"}}\n                        {{$conf := \"\"}}\n                        {{range .PDSSearchResponse.Entry}}\n                            {{if eq .Resource.ResourceType \"Patient\"}}\n                                {{range .Resource.Meta.Security}}\n                                    {{$conf = .Display}}\n                                {{end}}\n                            {{end}}\n                        {{end}}\n                        <td>Confidentiality {{$conf}}</td>\n                        {{if not .PDSSearchResponse.DeceasedDateTime.IsZero}}\n                        <span style=\"color: red;\">Patient is Deceased</span>\n                        {{end}}\n                    {{end}}\n                {{end}}\n        </div>\n        <div class=\"panel-body\">\n            <table class=\"table table-condensed table-striped\">\n                <thead>\n                    <tr>\n                        <td data-toggle=\"collapse\" data-target=\"#pds1\" class=\"accordion-toggle\"><span\n                                class=\"glyphicon glyphicon-chevron-down\"></span> Address</td>\n                        <td data-toggle=\"collapse\" data-target=\"#pds2\" class=\"accordion-toggle\"><span\n                                class=\"glyphicon glyphicon-chevron-down\"></span> Contact</td>\n                        <td data-toggle=\"collapse\" data-target=\"#pds3\" class=\"accordion-toggle\"><span\n                                class=\"glyphicon glyphicon-chevron-down\"></span> Other Details</td>\n                    </tr>\n                </thead>\n                <tbody>\n                    {{if eq .PDSResponse \"retrieve\"}}\n                        {{template \"pdsretrieve_tmplt\" .}}\n                    {{else}}\n                        {{t