iv>\n            \n            <div class=\"row\">\n                <div class=\"col-sm-12\">\n                    <div style=\"display:inline-block;width:100%;overflow-y:auto;margin-left: 2%;\">\n                        <ul class=\"timeline\">\n                            {{range $k,$t := .XDWState.WorkflowDocument.TaskList.XDWTask}}\n                            <li class=\"timeline-item\">\n                                    \n                                    <div class=\"timeline-badge primary\"><i class=\"fa fa-thumbs-up\"></i></div>\n                                \n                                <div class=\"timeline-panel\">\n                                    <div class=\"timeline-heading\">\n                                        {{if eq $t.TaskData.TaskDetails.Status \"COMPLETE\"}}\n                                        <h6 class=\"timeline-title\" style=\"color:darkgreen\">Task {{$t.TaskData.TaskDetails.ID}}\n                                            {{$t.TaskData.Description}}</h6>\n                                        {{else}}\n                                        <h6 class=\"timeline-title\" style=\"color:darkblue\">Task {{$t.TaskData.TaskDetails.ID}}\n                                            {{$t.TaskData.Description}}</h6>\n                                        {{end}}\n                                    </div>\n                                    <div class=\"timeline-body\">\n                                        <div class=\"row\">\n                                            <div class=\"col-sm-3\">\n                                                <label style=\"color:darkblue\">Type</label>\n                                                <p>{{$t.TaskData.TaskDetails.TaskType}}</p>\n                                            </div>\n                                            <div class=\"col-sm-5\">\n                                                <label style=\"color:darkblue\">Owner</label>\n                        